#include "../header.h"

class Solution {
public:
    int numSubmat(const vector<vector<int>>& mat) {
        const int n = mat.size();
        const int m = mat[0].size();

        int sum = 0;
        for (int i = 0; i < n; ++i) {
            for (int j = 0; j < m; ++j) {
                if (mat[i][j]) {
                    ++sum;
                }
            }
        }

        if (sum == n*m && n > 1 && m > 1) {
            return n*m*(n + 1)*(m + 1) / 2 / 2;
        }

        vector<vector<vector<bool>>> isOne(n, vector<vector<bool>>(m, vector<bool>(m)));

        auto isOneLine = [&](int i1, int j1, int j2) {
            for (int j = j1; j <= j2; ++j) {
                if (mat[i1][j] != 1) {
                    return false;
                }
            }
            return true;
        };


        for (int i = 0; i < n; ++i) {
            for (int j = 0; j < m; ++j) {
                for (int k = j; k < m; ++k) {
                    isOne[i][j][k] = isOneLine(i, j, k);
                    if (!isOne[i][j][k]) {
                        break;
                    }
                }
            }
        }

        auto isOneSub = [&](int i1, int j1, int i2, int j2) {
            for (int i = i1; i <= i2; ++i) {
                if (!isOne[i][j1][j2]) {
                    return false;
                }
            }
            return true;
        };

        int result = 0;
        for (int i1 = 0; i1 < n; ++i1) {
            for (int j1 = 0; j1 < m; ++j1) {
                for (int i2 = i1; i2 < n; ++i2) {
                    for (int j2 = j1; j2 < m; ++j2) {
                        if (isOneSub(i1, j1, i2, j2)) {
                            ++result;
                        } else {
                            break;
                        }
                    }
                }
            }
        }

        return result;
    }
};

